def open_pdf(file_path):
    # Utiliser la commande xdg-open pour ouvrir le fichier PDF avec le lecteur par défaut
    os.system(f'xdg-open "{file_path}"')

# Fonction pour charger les options au démarrage du programme
def load_options():
    global option_langue, option_alerte, option_close_apps
    home_dir = os.path.expanduser("~")
    hidden_dir = os.path.join(home_dir, ".PCR100-Remote")
    config_file = os.path.join(hidden_dir, "config.txt")

    # Vérifier si le fichier de configuration existe
    if os.path.exists(config_file):
        with open(config_file, "r") as file:
            lines = file.readlines()
            for line in lines:
                # Analyser chaque ligne pour extraire les options
                option, value = line.strip().split(": ")
                if option == "Option Langue":
                    option_langue = value  # Gardez la valeur sous forme de chaîne pour cette option
                elif option == "Option Alerte":
                    # Convertissez la valeur en booléen
                    option_alerte = value.lower() == "true"
                elif option == "Option Fermeture Apps":
                    # Convertissez la valeur en booléen
                    option_close_apps = value.lower() == "true"

    
# Appel de la fonction pour charger les options au démarrage du programme
load_options()

