# Définition de la fonction pour centrer une fenêtre sur l'écran
def center_window(window, width, height):
    # Récupérer les dimensions de l'écran
    screen_width = window.winfo_screenwidth()
    screen_height = window.winfo_screenheight()

    # Calculer les coordonnées pour centrer la fenêtre
    x = (screen_width - width) // 2
    y = (screen_height - height) // 2

    # Définir les nouvelles coordonnées de la fenêtre
    window.geometry(f"{width}x{height}+{x}+{y}")
    
# Fonction pour rechercher les ports USB
def find_usb_ports():
    usb_ports = glob.glob('/dev/ttyUSB*')
    return [port.split('/')[-1] for port in usb_ports]

# Fonction Quitter
def Exit():
    if option_alerte == False:
        if Running('qsstv') == True:
            sstv_id=get_pid("qsstv")
            os.kill(sstv_id,9)

        if Running('gpredict') == True:
            gpredict_id=get_pid("gpredict")
            os.kill(gpredict_id,9)

        if Running('rigctld'):
            terminate_rigctld()

        fenetre.destroy()
        return  # Ajout du return ici pour sortir de la fonction

    # Si option_alerte est True, afficher la boîte de dialogue de confirmation
    if option_langue == "Fr":
        reponse = messagebox.askquestion("Quitter le programme", "Voulez-vous quitter le programme et fermer les applications GPredict et QSSTV ?")
    else:
        reponse = messagebox.askquestion("Quit program", "Do you want to quit the program and close the GPredict and QSSTV applications ?")

    if reponse == "yes":
        if Running('qsstv'):
            sstv_id = get_pid("qsstv")
            os.kill(sstv_id, 9)

        if Running('gpredict'):
            gpredict_id = get_pid("gpredict")
            os.kill(gpredict_id, 9)

        if Running('rigctld'):
            terminate_rigctld()

        fenetre.destroy()
        
        
# Fonction pour mettre à jour la fréquence périodiquement
def update_frequency_periodically():
    global update_id  # Déclarer que vous utilisez la variable globale update_id
    current_frequency = get_frequency()
    if current_frequency is not None:
        update_frequency(current_frequency)
        # Stocker l'identifiant de rappel retourné par after() dans update_id
        update_id = fenetre.after(1000, update_frequency_periodically)
    else:
        # Arrêter la mise à jour périodique en annulant le rappel
        fenetre.after_cancel(update_id)


