# Fonction arrêter contrôle Rigctl
def terminate_rigctld():
    # Recherchez le processus rigctld
    rigctld_process = None
    for proc in psutil.process_iter(['pid', 'name']):
        if 'rigctld' in proc.name():
            rigctld_process = psutil.Process(proc.pid)
            break
    
    if rigctld_process:
        # Simulez Ctrl+C dans le terminal
        os.system("kill -INT " + str(rigctld_process.pid))
        # print(f"Le processus rigctld (PID {rigctld_process.pid}) a été terminé avec succès.")
    #else:
        # print("Processus rigctld non trouvé.")


