# Fonction lecture frequence
def get_frequency():
    # Définir l'hôte et le port du serveur rigctld
    host = 'localhost'
    port = 4532
    
    try:
        # Se connecter au serveur
        with socket.socket(socket.AF_INET, socket.SOCK_STREAM) as s:
            s.connect((host, port))
            
            # Envoyer une commande pour demander la fréquence
            s.send(b'f')  # Envoyer la commande 'f' pour obtenir la fréquence
            
            # Recevoir la réponse du serveur
            frequency = s.recv(1024).decode().strip()  # Recevoir la réponse et la décoder
            
            # Fermer la connexion
            s.close()
            
            # Convertir la fréquence en MHz
            frequency_MHz = float(frequency) / 1000000
            
            return frequency_MHz
    except ConnectionResetError:
        # Gérer l'erreur de réinitialisation de la connexion
        return None

# Fonction lecture mode de transmission
def get_mode():
    # Définir l'hôte et le port du serveur rigctld
    host = 'localhost'
    port = 4532
    
    try:
        # Se connecter au serveur
        with socket.socket(socket.AF_INET, socket.SOCK_STREAM) as s:
            s.connect((host, port))
            
            # Envoyer une commande pour demander la fréquence
            s.send(b'm')  # Envoyer la commande 'f' pour obtenir la fréquence
            
            # Recevoir la réponse du serveur
            mode = s.recv(1024).decode().strip()  # Recevoir la réponse et la décoder
            
            # Fermer la connexion
            s.close()
        
            return mode.split('\n')[0]
    
    except ConnectionResetError:
        # Gérer l'erreur de réinitialisation de la connexion
        return None



