# Fonction Volume
def Volume(select_volume):
    # Obtenir la valeur du volume du slider
    volume_value = slider_volume.get()
    # Convertir la valeur du volume en chaîne de caractères
    volume_str = str(volume_value / 10)  # Divisez par 10 pour obtenir une valeur entre 0.0 et 1.0
    # Créer la commande à envoyer au serveur via le socket
    command = f'L AF {volume_str}'.encode()  # Encodez la chaîne en bytes
    # Se connecter au serveur et envoyer la commande
    with socket.socket(socket.AF_INET, socket.SOCK_STREAM) as s:
        s.connect(('localhost', 4532))  # Se connecter au serveur
        s.send(command)  # Envoyer la commande
       

