# Fonction pour sauvegarder les options
def close_options(window, selected_langue, confirm_quit_var, close_apps_var):
    global option_langue, option_alerte, option_close_apps, label_reference
    
    # Mettre à jour les variables globales avec les valeurs actuelles des cases à cocher
    option_alerte = confirm_quit_var.get()
    option_close_apps = close_apps_var.get()
    # Fermer la fenêtre d'options
    window.destroy()
    
    
# Fonction pour sauvegarder les options
def save_options(window, selected_langue, confirm_quit_var, close_apps_var):
    global option_langue,option_alerte,option_close_apps

    # Récupérer le répertoire utilisateur
    home_dir = os.path.expanduser("~")
    
    # Créer le chemin complet du dossier caché
    hidden_dir = os.path.join(home_dir, ".PCR100-Remote")
    
    # Vérifier si le dossier caché existe, sinon le créer
    if not os.path.exists(hidden_dir):
        os.makedirs(hidden_dir)
    
    # Créer le chemin complet du fichier de configuration
    config_file = os.path.join(hidden_dir, "config.txt")
    
    # Mettre à jour les variables globales selon l'état actuel des cases à cocher
    option_alerte = confirm_quit_var.get()
    option_close_apps = close_apps_var.get()

    # Écrire les options dans le fichier de configuration
    with open(config_file, "w") as file:
        file.write(f"Option Langue: {option_langue}\n")
        file.write(f"Option Alerte: {option_alerte}\n")
        file.write(f"Option Fermeture Apps: {option_close_apps}\n")

    # Fermer fenêtre options
    window.destroy()

 

