# Fonction pour vérifier si une application est installée
def is_application_installed(application_name):
    # Listes des répertoires où les exécutables sont généralement stockés
    search_paths = ['/usr/bin', '/usr/local/bin']

    # Parcourir les répertoires de recherche
    for path in search_paths:
        # Construire le chemin complet de l'exécutable
        executable_path = os.path.join(path, application_name)
        # Vérifier si l'exécutable existe
        if os.path.exists(executable_path):
            return True

    # Si l'exécutable n'est pas trouvé dans aucun des répertoires de recherche
    return False

