# Fenêtre options
def Options():
    global options_window, ok_button, save_button
    global confirm_quit_var, close_apps_var
    global confirm_quit_check, close_apps_check
    global image_switch_langue  

    options_window = Toplevel(fenetre)
    options_window.title("Options")
    
    # Centrer la fenêtre d'options par rapport à la fenêtre principale
    options_window_width = 380
    options_window_height = 300
    center_window(options_window, options_window_width, options_window_height)

    confirm_quit_var = BooleanVar(value=option_alerte)
    close_apps_var = BooleanVar(value=option_close_apps)

    # Charger l'image et stocker l'objet PhotoImage dans une variable globale
    image_switch_langue = PhotoImage(data=icone_translation)

    Bouton_switch = Button(options_window, bd=3, cursor="hand2", command=Changer_langue)
    Bouton_switch.pack(padx=20, pady=20)
    
    # Configurer l'image du bouton
    Bouton_switch.configure(image=image_switch_langue)

    Boite_Options = LabelFrame(options_window, text=" Options ")
    Boite_Options.pack(padx=20, pady=20)
    
        
    # Création des cases à cocher et affectation aux variables correspondantes
    global confirm_quit_check, close_apps_check 
    confirm_quit_check = Checkbutton(Boite_Options, text="Demande de confirmation avant de quitter", variable=confirm_quit_var, anchor='w',width=36)
    confirm_quit_check.pack(anchor='w')

    close_apps_check = Checkbutton(Boite_Options, text="Fermer les applications en quittant", variable=close_apps_var, anchor='w',width=36)
    close_apps_check.pack(anchor='w')
    
    # Mettre à jour l'état initial des cases à cocher
    confirm_quit_check.select() if option_alerte else confirm_quit_check.deselect()
    close_apps_check.select() if option_close_apps else close_apps_check.deselect()

    # Boite boutons
    Boite_Boutons = LabelFrame(options_window, text="", border = 0)
    Boite_Boutons.pack(padx=20, pady=20)
    
    ok_button = Button(Boite_Boutons, text="Valider", width=8, command = lambda: close_options(options_window, selected_langue, confirm_quit_var, close_apps_var))
    ok_button.grid(row=0, column=0, padx=(0, 10))

    save_button = Button(Boite_Boutons, text="Sauvegarder", command = lambda: save_options(options_window, selected_langue, confirm_quit_var, close_apps_var))
    save_button.grid(row=0, column=1, padx=(10, 0))
    
    # Mettre à jour le texte des cases à cocher et des boutons
    update_options(confirm_quit_check, close_apps_check, ok_button, save_button)

# Fonction pour changer la langue
